import {Row,Col} from 'react-bootstrap'
const Services = () => {
    return (
        <div>
             <div className="headerServices">
                <h1>Nos Services</h1>
                <p>Ici nous vous presentons les differents que nous Offrons</p>
             </div>
             <Row>
                <Col sm={4}>
                    <div>
                        <div> <h1> ici on va mettre l image</h1></div>
                    </div>
                </Col>
                <Col sm={4}></Col>
                <Col sm={4}></Col>
             </Row>
        </div>
    );
};

export default Services;
